import  data from '../data.json';



const Character = () => {
    //console.log(data['results']['9']['vehicles']);
    return (
        <div> 
            Este es un componente para pruebas con un JSON
            <ul>
                {data['results'].map(character => <i> {character.name}</i>)}
            </ul>
        </div>
    )
}

export default Character
